import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      articles:[]
    }
  }
  componentDidMount(){
    fetch('http://newsapi.org/v2/top-headlines?country=us&category=business&apiKey=88d4f86e316140e089929ed953098371')
    .then(response => 
      response.json())
    .then(data => 
      console.log(data));
  }
  render(){
    return (
      <div className="App">
        Hello
      </div>
    )
  }
}

export default App;
